import React from 'react';
import NavBar from '../NavBar/NavBar';
import Logo from '../../images/i-can-t-keep-calm-plant-lives-matter.png';
import './Home.scss';

export default function Home() {
    return (
        <div className="home">
            <img src={Logo} className="" alt="Logo" />
            <NavBar />
        </div>
    )
}
